INSERT INTO `noticia` (`id`, `titulo`, `descripcion`, `imagen`, `fecha`, `subtitulo`, `mime`, `id_categoria`, `activo`) VALUES
(1, 'imagen1', '<p>imagen1</p>\r\n', , '2018-06-18 20:03:42', 'esta va en el inicio', '', 1, 1),
(2, 'imagen2', 'sasasasas', , '2018-06-18 20:04:18', 'zs sasa as asas ', '', 1, 1),
(3, 'imagen3', '<p>El principal objetivo de la elongaci&oacute;n es la de preparar y calentar el m&uacute;sculo para el posterior ejercicio. Para comprender esto debemos partir del hecho de que los m&uacute;sculos est&aacute;n fr&iacute;os cuando uno est&aacute;&nbsp;en reposo y llevarlos a una exigencia muy alta de repente y sin trabajo o precalentamiento previo puede significar estiramientos, lesiones, torceduras, dolores de todo tipo, algunos m&aacute;s profundos que otros. Al mismo tiempo, la elongaci&oacute;n siempre es recomendada tambi&eacute;n al finalizar la actividad para que ninguno de los m&uacute;sculos utilizados en la misma quede en permanente estado de tensi&oacute;n, pudiendo eso tambi&eacute;n generar complicaciones</p>\r\n', , '2018-06-18 20:04:51', 'elongacion', '', 2, 1);
INSERT INTO `noticia` (`id`, `titulo`, `descripcion`, `imagen`, `fecha`, `subtitulo`, `mime`, `id_categoria`, `activo`) VALUES
(4, 'zumba', '<p>La zumba es una mezcla de ritmos latinos salsa, merengue, flamenco o bachata&nbsp;y ejercicios aer&oacute;bicos que se ha convertido en la rutina de moda para perder peso. Se trata de una disciplina fitness ideada por un colombiano, Alberto &#39;Beto&#39;&nbsp;P&eacute;rez, y su nombre es un derivado de la palabra rumba, que es como los colombianos denominan coloquialmente a las fiestas. La zumba naci&oacute;&nbsp;cuando su creador, a finales de los 90, era profesor en un gimnasio de Cali (Colombia). Un d&iacute;a se olvid&oacute;&nbsp;de la m&uacute;sica para la clase, as&iacute;&nbsp;que no lo dud&oacute;&nbsp;ni un momento, fue a su coche y tom&oacute;&nbsp;algunos de los cds de m&uacute;sica que llevaba, en su mayor&iacute;a m&uacute;sica latina. Tal fue el &eacute;xito de aquella clase que decidi&oacute;&nbsp;convertirlo en la disciplina deportiva que es hoy, y que en muy poco tiempo comenz&oacute;&nbsp;a tener &eacute;xito y fama internacional cuando en 2001 &#39;Beto&#39;&nbsp;P&eacute;rez se traslad&oacute;&nbsp;a Miami. Quienes la practican aseguran que la clave para que la zumba sea el ejercicio estrella para perder peso radica en la mezcla de ritmos r&aacute;pidos y lentos combinados con series de ejercicios, con lo que, adem&aacute;s de bajar esos kilos de m&aacute;s que tanto cuesta eliminar, tonificamos nuestra musculatura. Pero independientemente de que los asistentes a sus clases perdieran peso o no, lo que Alberto P&eacute;rez quer&iacute;a era que disfrutaran con el ejercicio, que se divirtieran y se sintieran bien consigo mismos y, en definitiva, que fueran felices; que asistir a las clases para hacer ejercicio fuera una aut&eacute;ntica fiesta, una rumba. Como curiosidad, cabe destacar que la zumba se ha convertido en la salida profesional de muchos de los j&oacute;venes de origen latinoamericano que residen en Estados Unidos. Y es que, desde que se comercializara en dicho pa&iacute;s, estos j&oacute;venes han visto en su facilidad innata para bailar y para seguir el ritmo su salida profesional como monitores de zumba en los numerosos centros deportivos en los que se imparte esta disciplina deportiva.</p>\r\n', , '2018-06-18 22:59:45', 'zumba', '', 2, 1),
(5, 'salsa', '<p>La salsa es g&eacute;nero musical bailable resultante de la s&iacute;ntesis del son cubano, y otros g&eacute;neros de m&uacute;sica caribe&ntilde;a, con el jazz y otros ritmos estadounidenses. La salsa tiene escenas regionales puertorrique&ntilde;a, venezolana, dominicana, colombiana y de otros pa&iacute;ses de Am&eacute;rica Latina. La salsa fue consolidada como un &eacute;xito comercial por m&uacute;sicos de origen puertorrique{os en la ciudad de Nueva York en la d&eacute;cada de 1960, si bien sus ra&iacute;ces se remontan a d&eacute;cadas anteriores en pa&iacute;ses del Gran Caribe. La salsa abarca varios estilos como la salsa dura, la salsa rom&aacute;ntica y la timba.</p>\r\n', , '2018-06-18 23:12:45', 'salsa', '', 2, 1);
