INSERT INTO `quienes_somos` (`id`, `titulo`, `descripcion`, `imagen_fondo`) VALUES
(1, 'DanzArte', '<p>MISI&Oacute;N: &ldquo;Promover la formaci&oacute;n art&iacute;stica integral del ser humano en las diferentes etapas de su vida, poniendo a su alcance una educaci&oacute;n y capacitaci&oacute;n de alta calidad para poder alcanzar el m&aacute;ximo potencial creativo y expresivo en un ambiente placentero&rdquo;.</p>\r\n\r\n<p>VISI&Oacute;N: &ldquo;Ser la Instituci&oacute;n art&iacute;stica l&iacute;der en nuestro pa&iacute;s, reconocida por su compromiso permanente con la excelencia y la calidad de ense&ntilde;anza, dando la mejor atenci&oacute;n posible al cliente y promoviendo la satisfacci&oacute;n en los ni&ntilde;os, j&oacute;venes y adultos a trav&eacute;s de su oferta de servicios educativos y programas de capacitaci&oacute;n y desarrollo de alta calidad de nivel internacional&rdquo;.</p>\r\n\r\n<p>CALIDAD: La Direcci&oacute;n de esta Instituci&oacute;n se encuentra firmemente comprometida con la Calidad, la que es entendida como forma de trabajo que ha de llevarnos a ofrecer un servicio y una atenci&oacute;n con una clara orientaci&oacute;n al alumno. Las directrices que definen nuestra pol&iacute;tica de calidad y desde las cuales queremos trabajar en la definici&oacute;n de objetivos medibles son las siguientes: La Calidad es para nosotros atender y satisfacer las expectativas de nuestros alumnos, orientarnos hacia la mejora de procesos y poder atender a la perfecci&oacute;n a un p&uacute;blico cada vez m&aacute;s exigente. La Calidad es la mejora de nuestra gesti&oacute;n interna, dot&aacute;ndonos de un equipo de colaboradores estable y adaptado a nuestros requerimientos actuales. Para nosotros el capital m&aacute;s importante es el capital humano.</p>\r\n\r\n<p>El Estudio prioriza el Arte desde el aspecto socio-afectivo donde el alumno es protagonista, por lo tanto se realiza un seguimiento personal y detallado de su desarrollo.</p>\r\n\r\n<p>El Estudio tiene como meta estimular el trabajo arm&oacute;nico de cada grupo, promoviendo la calidad de aprendizaje y la integraci&oacute;n.</p>\r\n\r\n<p>Nuestro deseo es brindar las herramientas necesarias para que cada alumno descubra, en el mundo art&iacute;stico, aquello que le de plena satisfacci&oacute;n.</p>\r\n', );

